MongoDB flattening a nested array without unwind<p>I've been trying to flatten a field of array that occasionally has a nested array when its size is 1 as you can see in example below. (This happened due to a previous error I made with updateMany() while trying to put every string in array but somehow, I put the string in a nested array).</p>
<p>This is a Japanese-English dictionary database and &quot;re_pri&quot; stands for reading-priority. Not every, but most documents have this field inside.</p>
<p>I managed to flatten the array with unwind but later I found out that unwind cannot be used with updateMany(). So, I started searching for another way to accomplish this but couldn't find a way so far.</p>
<pre><code>{
  &quot;r_ele&quot;: [{
      &quot;re_pri&quot;: [
        &quot;ichi1&quot;,
        &quot;news1&quot;,
        &quot;nf10&quot;
      ]}],
},
{
  &quot;r_ele&quot;: [{
      &quot;re_pri&quot;: [
        [
          &quot;ichi1&quot;
        ]
      ]
}]
}
</code></pre>
<p>I tried setting it to a new field called &quot;a&quot;, assigning it to the <code>re_pri</code> field then unsetting the &quot;a&quot; field. But it didn't work the way I expected.</p>
<p>This is the way I tried with aggregation pipeline</p>
<pre><code>[
  {
    $match: {
      &quot;r_ele.re_pri&quot;: {
        $exists: 1,
      },
    },
  },
  {
    $project: {
      &quot;r_ele.re_pri&quot;: 1,
      a: {
        $reduce: {
          input: &quot;$r_ele.re_pri&quot;,
          initialValue: [],
          in: {
            $cond: {
              if: {
                $and: [
                  {
                    $eq: [
                      {
                        $type: &quot;$$this&quot;,
                      },
                      &quot;array&quot;,
                    ],
                  },
                  {
                    $eq: [
                      {
                        $size: &quot;$$this&quot;,
                      },
                      1,
                    ],
                  },
                ],
              },
              then: {
                $concatArrays: &quot;$$this&quot;,
              },
              else: {
                $concatArrays: [
                  &quot;$$this&quot;,
                  &quot;$$value&quot;,
                ],
              },
            },
          },
        },
      },
    },
  },
  {
    $unwind: &quot;$a&quot;,
  },
  {
    $set: {
      &quot;r_ele.re_pri&quot;: &quot;$a&quot;,
    },
  },
  {
    $unset: &quot;a&quot;,
  }
]
</code></pre>
<p>this is the output:</p>
<pre><code>{
  &quot;a&quot;: [
    &quot;ichi1&quot;,
    &quot;news1&quot;,
    &quot;nf10&quot;
  ]
},
{
  &quot;a&quot;: [
    [
      &quot;ichi1&quot;
    ]
  ]
}
</code></pre>
<p>But my expectation was:</p>
<pre><code>{
  &quot;a&quot;: [
    &quot;ichi1&quot;,
    &quot;news1&quot;,
    &quot;nf10&quot;
  ]
},
{
  &quot;a&quot;: [
      &quot;ichi1&quot;
  ]
}
</code></pre>
<p>What am I doing wrong?</p>

