How to use MongoDB cli database tools in railway?<p>in a current MERN stack project (<a href="https://github.com/LuckyChimp/interactive-comments-section" rel="nofollow noreferrer">github repo</a>) I am trying to implement a mechanism that resets two documents in my mongo db to default data once a day at midnight to reset changes made by others to the <a href="https://interactive-comments-section-production.up.railway.app/" rel="nofollow noreferrer">live website</a> of the project. For this I use the <a href="https://www.mongodb.com/docs/database-tools/" rel="nofollow noreferrer">mongodb cli database tools</a> to import the corresponding two .json files with the respective data using the command <a href="https://www.mongodb.com/docs/database-tools/mongoimport/" rel="nofollow noreferrer"><code>mongoimport</code></a>.</p>
<p>code excerpt from <a href="https://github.com/LuckyChimp/interactive-comments-section/blob/master/backend/config/db.js" rel="nofollow noreferrer">db.js</a>:</p>
<pre><code>const Comment = require('../models/commentModel');
const User = require('../models/userModel');

const restoreDefaultData = async () =&gt; {
    const { spawn } = require('child_process');
    const restoreCollection = (collectionName) =&gt; {
        const restoreProcess = spawn('mongoimport', [
            `--uri=&quot;${process.env.MONGO_URI}&quot;`,
            `--collection=${collectionName}`,
            `--file=./.mongodb/default-data/${collectionName}.json`,
            '--jsonArray'
        ]);

        restoreProcess.on('exit', (code, signal) =&gt; {
            // handle success and error messages
        });
    };

    // first delete all comment data and then restore the default comment data
    await Comment.deleteMany({});
    restoreCollection('comments');

    // first delete all user data and then restore the default user data
    await User.deleteMany({});
    restoreCollection('users');
};
</code></pre>
<p>In my local project this works without problems, because there are also the <a href="https://www.mongodb.com/docs/database-tools/" rel="nofollow noreferrer">mongodb cli database tools</a> installed. To provide the <a href="https://interactive-comments-section-production.up.railway.app/" rel="nofollow noreferrer">live website</a> I use railway.</p>
<p>After the building process started with the command..</p>
<pre><code>npm i --prefix frontend &amp;&amp; npm run build --prefix frontend
</code></pre>
<p>..I now get the following error in the building console:</p>
<pre><code>node:events:491
throw er; // Unhandled 'error' event
^
Error: spawn mongoimport ENOENT
    at Process.ChildProcess._handle.onexit (node:internal/child_process:285:19)
    at onErrorNT (node:internal/child_process:485:16)
    at processTicksAndRejections (node:internal/process/task_queues:83:21)
Emitted 'error' event on ChildProcess instance at:
    at Process.ChildProcess._handle.onexit (node:internal/child_process:291:12)
    at onErrorNT (node:internal/child_process:485:16)
    at processTicksAndRejections (node:internal/process/task_queues:83:21) {
        errno: -2,
        code: 'ENOENT',
        syscall: 'spawn mongoimport',
        path: 'mongoimport',
        spawnargs: [
            '--uri=&quot;mongodb+srv://admin:i8myuWN4tX9yopvO@cluster0.sksfeun.mongodb.net/app?retryWrites=true&amp;w=majority&quot;', '--collection=comments',
            '--collection=comments',
            '--file=./.mongodb/default-data/comments.json',
            '--jsonArray'
        ]
    }
</code></pre>
<p><strong>How do I manage to use the mongodb cli database tools in my railway deployment? Or is there even another way to reset the two documents of the database daily to certain default data?</strong></p>
<p>I already tried to include the download and installation process of the mongodb cli database tools in the railway build command but this ended up in an error as well.</p>
<p>Am slowly a little clueless and look forward to any answer!</p>

